@Cẩm Xuyên
- (huyện) Huyện ven biển ở phía đông nam tỉnh Hà Tĩnh. Diện tích 628,1km2. Số dân 159.000 (1997). Địa hình đồng bằng ven biển, đất phù sa, cát biển, phía tây có đồi núi Mộc Lèn (497m). Sông Nghèn chảy qua Cửa Nhượng. Hồ Thượng Tuy cũng có dòng sông chảy ra Cửa Nhượng, ở miền núi đồi có hồ Kẻ Gỗ cung cấp nước tưới. Quốc lộ 1, đường 22 chạy qua. Từ xưa là huyện của tỉnh Hà Tĩnh, thuộc tỉnh Nghệ Tĩnh (1975-91), từ 20-7-1991 trở lại tỉnh Hà Tĩnh gồm 1 thị trấn Cẩm Xuyên huyện lị, 26 xã
- (thị trấn) h. Cẩm Xuyên, t. Hà Tĩnh

